CREATE EXTENSION IF NOT EXISTS "uuid-ossp";

CREATE TABLE IF NOT EXISTS districts (
  "id" uuid DEFAULT uuid_generate_v4 () PRIMARY KEY,
  "ibgeCode" CHAR(10) NOT NULL,
  "name" VARCHAR(255) NOT NULL,
  "cityName" VARCHAR(255) NOT NULL,
  "uf" CHAR(2) NOT NULL,
  "cityId" uuid REFERENCES cities("id")
);


UPDATE districts SET "cityId" = cities."id"
FROM cities
WHERE districts."cityName" = cities."name" AND districts."uf" = cities."uf";

ALTER TABLE districts ALTER column "cityId" SET NOT NULL;